import React from 'react';

const UserDiv = ({ user }) => {
  return (
    <div>
        <h2>{user.name}</h2>
        <p>{user.email}</p>
    </div>
  );
};

const UtilisateursPage = () => {
  return (
    <div>
        <h1>Les utilisateurs</h1>
        <UserDiv user={{ name: 'John Doe', email: 'test@gmail.fr' }} />
        <UserDiv user={{ name: 'John Doe', email: 'test@gmail.fr' }} />
    </div>
  );
};

export default UtilisateursPage;
